import React from 'react';
import { Link } from 'react-router-dom';
import { CartBlock } from '../cart-block'
import './header.css';

export const Header = () => {
  return (
    <div className='header'>
        <div className='wrapper'>
            <Link className='home-cart' to="/">AppleStore</Link>
        </div>
        <div className='header-cart'>
            <CartBlock />
        </div>
    </div>
  )
}
